import React from "react";
import axios from "axios";

class FetchProd extends React.Component {
  state = {
    products: []
  };

  componentDidMount() {
    axios.get(`/products`).then(res => {
      this.setState({ products });
    });
  }

  render() {}
}

export default FetchProd;
